const gymcontainerStyle = theme => ({
    paper: {
        height: "100%",
        [theme.breakpoints.up("sm")]: {
            marginTop: "4rem"
        }
    },
    tab:{
        flexGrow: "1"
    }
});



export default gymcontainerStyle;
